import React from 'react';
import { Grid, Paper, Typography, List, ListItem, ListItemText, } from '@material-ui/core';



const styles = {
    paper: {
        left : {
        padding : "15px",
        margin : "5px",
        marginBottom : "10px",
        textTransform : "capitalize"
        },
        right : {
            padding : "15px",
            margin : "5px",
            marginBottom : "10px",

        }
    }
}

export default ({exercises}) => {
    return (
        <div>
        <Grid container>
            <Grid item xs>
                <Paper style = {styles.paper.left}>
                    {exercises.map(([group, items]) => {
                        return (
                    <div>
                    <Typography variant="subtitle1">{group}</Typography>
                    <List component="nav" aria-label="secondary mailbox folders">

                            {items.map(x => {
                                return (
                                    <ListItem button>
                                <ListItemText primary={x.title} />
                                </ListItem>
                                )
                            })}

                    </List>
                    </div>
                    )

                    })
                    }
                </Paper>
        </Grid>
        <Grid item xs>
                <Paper style = {styles.paper}>
                    <Typography variant = "h4" >Welcome!
                    </Typography>
                    <Typography variant = "body1" >Please select any exrcise from the list on the left
                    </Typography>
                </Paper>
        </Grid>

        </Grid>
        </div>
    )
}
